  useEffect(()=>{
    askUserName();
  },[]);
  const askUserName = ()=>{
    const userName = prompt("이름을 입력하세요");
    console.log("userName", userName);

    socket.emit("login", userName)
  }
  return (
    <div>
      <div className="App"></div>
    </div>
  );
}

export default App;
